import React from 'react';
import BottomBar from '../../components/admin/adminHome/BottomBar';


const AdminHome = () => {
    return (
        <div>
            <BottomBar />
            <div className='container'>
                <div className='row' style={{backgroundColor:'#0E1521', color: 'white'}}>
                    <div className='col-12'>
                        <h5>Nouvelles Reservations</h5>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default AdminHome
